[Babes] Liona (Lionas Roar / 08.26.2013)

Wow! Stunning post-war 50s setting, de-saturated color and driving raspy big band sound. Touching, hot and very very sexy! Really it's a great scene to watch if you're into retro. Liona is reminiscent of early Brigitte Bardot or Betty Davis in a Bergmann film, James; a great stand in for Boggie or Grant. Of course, none of which detracts from the actors performances as they enact what resembles a &quot;when Johnnie comes home from the war&quot; scenario. Liona and James Brossman give it up in classic style. Truly one of the best scenes I've watched - actually my number one fav at this point (make it yours.) If you only have time to watch one scene this week, watch this one!

